import axios from "axios";
import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./dashboardContent.css";

export default class dashboardContent extends Component {
  

  render() {
    const { Tournaments } = this.state;
    return (
      <div className="dashboardContent">
        <div className="container">
          <Link to="/dashboard/tournament/create" className="createButton">Create Tournament</Link>
          <table>
            <tr>
              <th>Name</th>
              <th>Status</th>
              <th>Prize</th>
              <th>Game</th>
              <th>Region</th>
            </tr>
            {Tournaments.map((Tournaments) => (
              <tr>
                <td>{Tournaments.name}</td>
                <td>{Tournaments.status}</td>
                <td>{Tournaments.prize}</td>
                <td>{Tournaments.game}</td>
                <td>{Tournaments.region}</td>
              </tr>
            ))}
          </table>
        </div>
      </div>
    );
  }
}
